import React from "react";
import { NavLink } from "react-router-dom";
const Navbar = () => {
    return (
        <>
        <NavLink to="/">About</NavLink>
        <NavLink to="/service">Service</NavLink>
        <NavLink to="/contact">Contact</NavLink>
        <br/>
        {/* <a href="/">About us</a>
        <a href="/contact">Contact us</a> */}
        </>
    );
};
export default Navbar;
